package sample_0324;

public class GuGuDan {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int b = 1; b <= 9; b++) {
			for (int a = 2; a <= 9; a++) {
				System.out.print(a + "*" + b + "=" + (a * b) + " ");
			}
			System.out.println(" ");

		}

	}

}